  false,\n\t\"url\": null,\n\t\"notes\": \"The counties comprised in this dataset
  have been chosen based on the relation to the Maumee River basin, a portion of the
  Lake Erie basin and correlated with the northwestern counties in Ohio which form
  composite continuous lidar data for the Lake Erie basin and the Great Lakes basin
  system. The Indiana Statewide Imagery and LiDAR project includes data captured at
  the following specifications: This project is comprised of Wells and Adams counties
  collected in 2012, as part of Area 2; Noble, DeKalb and Steuben counties collected
  in 2010; Allen county collected in 2009.\",\n\t\"license_title\": null,\n\t\"extras\":
